import React from 'react';
import style from './Category.module.css';
import Category_container from './Category_container';

function Category({textChanged}) {
  if (textChanged) {
    return null;
  }

  return (
    <div className={style.container}>
      <Category_container>ABOUT</Category_container>
      <Category_container>MUSIC</Category_container>
      <Category_container>VISUALS</Category_container>
      <Category_container>CONTACT</Category_container>
    </div>
  );
}

export default Category;
